class Scenario {
    constructor(
      id,
      scenarioName,
      description,
      version,
      archived,
      auditList,
      fileVersion,
      shockClassification,
      deltaComment
    ) {
      this.id = id;
      this.scenarioName = scenarioName;
      this.description = description;
      this.version = version;
      this.archived = archived;
      this.auditList = auditList;
      this.fileVersion = fileVersion;
      this.shockClassification = shockClassification;
      this.deltaComment = deltaComment;
      this.scenarioNameAndVersion = `${scenarioName} (v.${fileVersion})`;
    }
  }
  
  export default Scenario;
  